import { applyCfRuleDxf } from './applyCfRuleDxf.js';

/**
 * 包含错误
 */
function containsErrors(sheet, cellInfo, cfRule) {
    if (typeof cellInfo.cellData === 'object' &&
        cellInfo.cellData.type === 'error') {
        applyCfRuleDxf(cfRule, sheet, cellInfo);
        return true;
    }
    return false;
}

export { containsErrors };
